description:
This is a compilation of the two best albums from the Cult-Jazz-Rock band Gong.

Since both albums are more or less in the same style (which is unusual in this case since the band had a zillion line-ups through the years) and can easily fit together on todays CD's I decided to put them out as one torrent.

I you want to separate them: tracks 1-6 are from the Gazeuse! album, tracks 7-12 are from Expresso II. Covers of both are included, so you decide what to do.

If you are a jazzrock fan this is a definite must have!

A lot of info is available at: http://en.wikipedia.org/wiki/Gong_(band)

